script: |
  super -f text -I q7838.spq | sort > q7838.out

inputs:
  - name: q7838.spq
    data: |
      SELECT - ( col0 ) * + col1 + + - col1 + - col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + 9 + - 68 BETWEEN NULL AND - + col2 + + + col1;
  - name: tab1

outputs:
  - name: q7838.out
    data: |
      -824
